description:
The sixth season of the American television comedy series How I Met Your Mother premiered on September 20, 2010.

How I Met Your Mother is an American situation comedy that premiered on CBS on September 19, 2005. The show was created by Craig Thomas and Carter Bays.
As a framing device, the main character, Ted Mosby (Josh Radnor),[1] with narration by Bob Saget, in the year 2030 recounts to his son and daughter the events that led to him meeting their mother, which explains the title and allows for a narration in the past tense. How I Met Your Mother's other main characters are Lily Aldrin (Alyson Hannigan), Marshall Eriksen (Jason Segel), Robin Scherbatsky (Cobie Smulders) and Barney Stinson (Neil Patrick Harris).[1]
The show was renewed for a sixth season by CBS, which premiered on September 20, 2010.

